export default class Leaderboard extends Component {
    render() {
        return (
            <div>
                <h1>HonestPoint Leaderboard</h1>
                <div className="topThreeCards">Abel Marin</div>
                <div className="topThreeCards">Abel Marin</div>
                <div className="topThreeCards">Abel Marin</div>

                <div className="otherCards">Steve Bell</div>
                <div className="otherCards">Steve Bell</div>
                <div className="otherCards">Steve Bell</div>
                <div className="otherCards">Steve Bell</div>

            </div>
        )
    }
}
